import "./project.css";

export default function Project(props) {
    // const [index, setIndex] = useState(0)


  return (
    <div className="container">
      <h4>{props.name}</h4>
      <h6>
        <a href={props.live} target="_blank">
          Live Application
        </a>
      </h6>
      <h6>
        <a href={props.github} target="_blank">
          Github Repository
        </a>
      </h6>
    </div>
  );
}

